import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';


const styles= {
    container:{
        height: '100vh'
    },
    htmlstart: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '10%',
    },
    bodystart: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '15%',
        // marginTop: '1%'
    },
    h1start: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '20%',
        // marginTop: '13%'

    },
    textstart: {
        color: 'white',
        fontFamily: "cursive",
        marginLeft: '25%',
    },
    textend: {
        color: 'white',
        fontFamily: "cursive",
        marginLeft: '25%',
    },
    h1end: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '20%',
    },
    bodyend: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '15%',
        // marginTop: '13%'
    },
    htmlend: {
        color: 'grey',
        fontFamily: "cursive",
        marginLeft: '10%',
        // marginTop: '1%'
    },
    tags: {
        color: 'grey',
        fontFamily: "cursive"
    },
    htmlrow: {
        height: `10vh`
    },
    bodyrow: {
        height: `15vh`
    },
    h1row: {
        height: `20vh`
    }
}
const tags = {
    htmlstart: "<html>",
    bodystart: "<body>",
    h1start: "<h1>",
    htmlend: "</html>",
    bodyend: "</body>",
    h1end: "</h1>",
}
const Landing = () => {

    return(

        <>
        <Container style={styles.container}>
        <br></br>    
        <Row style={styles.htmlrow}><p style={styles.htmlstart}>{tags.htmlstart}</p></Row>
        <Row style={styles.bodyrow}><p style={styles.bodystart}>{tags.bodystart}</p></Row>
        <Row style={styles.h1row}><p style={styles.h1start}>{tags.h1start}</p></Row>
        <h1 style={styles.textstart}>Chase Lipscomb,</h1>
        <h1 style={styles.textend}>Web Developer</h1>
        <Row><p style={styles.h1end}>{tags.h1end}</p></Row>
        <Row style={styles.bodyrow}><p style={styles.bodyend}>{tags.bodyend}</p></Row>
        <Row style={styles.htmlrow}><p style={styles.htmlend}>{tags.htmlend}</p></Row>
        </Container>
        </>
    )
}
export default Landing
